import React from 'react';

export default class Form extends React.Component {
    state = {
        firstname: '',
        lastname: '',
        username: '',
        email: '',
        password: ''
    }
    render(){
        return(
            <form>
                <input placeholder= 'First Name' value= {this.state.firstname}/>
            </form>
        );
    }
}
